import React, { Component } from 'react';


class FormalTextInput extends Component {

  constructor(props) {
    super(props)
    this.state = {
      text:''
    }
  }

  render() {
    return (
      <input type="text" value={this.state.text}  />
    )
  }

}

export default FormalTextInput;
